			"max_difficulty": "casual",
			"on_talk": "speech_dialog(	null,
											[~Fountains, and other water dispensers,\\nare very helpful.~],
											[~If you drink from them,\\nyou will restore all of your health!~] )",
			"type": "help_npc",
